INSERT INTO `wp_posts` VALUES (1,1,'2011-04-14 04:23:55','2011-04-14 04:23:55','<div id=\"postgallery-wrapper\">[nggallery id=8]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nMovings is an all-digital label based out of Chicago that launched in early 2011.\r\n\r\nFezziwig was asked to create a logo as well as a Genesis Framework child theme based on the Amped layout.\r\n\r\nPlease visit the site at <a href=\"http://themovingslabel.com\" target=\"_blank\">themovingslabel.com</a>, or click on the images at right to view enlarged screen shots.\r\n\r\n</div>','The Movings Label','','publish','closed','closed','','the-movings-label','','','2011-05-31 16:36:23','2011-05-31 16:36:23','',0,'http://fezziwigwebworks.com/?p=1',0,'post','',0),(4,1,'2011-04-14 07:09:55','2011-04-14 07:09:55','','0014-5_EPK','','inherit','open','open','','0014-5_epk','','','2011-04-14 07:09:55','2011-04-14 07:09:55','',1,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/0014-5_EPK.jpg',0,'attachment','image/jpeg',0),(7,1,'2011-04-14 07:14:02','2011-04-14 07:14:02','<div id=\"postgallery-wrapper\">[nggallery id=4]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nMike Evin is a Montreal-based pop artist.\r\n\r\nFezziwig was asked to create a Genesis Framework child theme using the Amped child theme\'s layout; we customized it to fit with Mike Evin\'s new CD release.\r\n\r\nPlease click on the images at right to view enlarged screen shots.\r\n\r\n</div>','Mike Evin','','publish','closed','closed','','mike-evin','','','2013-12-09 14:41:31','2013-12-09 22:41:31','',0,'http://fezziwigwebworks.com/?p=7',0,'post','',0),(8,1,'2011-04-14 07:12:48','2011-04-14 07:12:48','','header_bg','','inherit','open','open','','header_bg','','','2011-04-14 07:12:48','2011-04-14 07:12:48','',7,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/header_bg.png',0,'attachment','image/png',0),(12,1,'2011-04-15 16:10:54','2011-04-15 16:10:54','<div id=\"postgallery-wrapper\">[nggallery id=6]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nFezziwig has been working with author and speaker Dean Sluyter since nearly the dawn of the World Wide Web.\r\n\r\nOur first site for Dean dates back to 1996, when his first book, Why The Chicken Crossed The Road, was published.\r\n\r\nOriginally written in ColdFusion using a custom CMS, Dean\'s site has gone through several iterations.  Its current version was developed from scratch in Drupal.\r\n\r\nPlease visit the site at <a href=\"http://deansluyter.com\" target=\"_blank\">deansluyter.com</a>, or click on the images at right to view enlarged screen shots.\r\n\r\n</div>','Dean Sluyter','','publish','closed','closed','','dean-sluyter','','','2011-05-31 16:33:48','2011-05-31 16:33:48','',0,'http://fezziwigwebworks.com/?p=12',0,'post','',0),(14,1,'2011-04-16 03:52:30','2011-04-16 03:52:30','<div id=\"postgallery-wrapper\">[nggallery id=5]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nMusic Geek Services is an artist services firm based out of Nashville and Chicago, dedicated to the music industry.\r\n\r\nFezziwig was asked to update the logo and create a WordPress theme for the new MGS web site.\r\n\r\nFezziwig and Music Geek Services chose to achieve the resulting web site by highly customizing a Genesis Framework child theme.\r\n\r\nPlease click on the images at right to view enlarged screen shots.\r\n\r\n</div>','Music Geek Services','','publish','closed','closed','','music-geek-services','','','2013-12-09 14:41:17','2013-12-09 22:41:17','',0,'http://fezziwigwebworks.com/?p=14',0,'post','',0),(17,1,'2011-04-16 04:06:09','2011-04-16 04:06:09','<div id=\"postgallery-wrapper\">[nggallery id=3]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nBroken is a musical adapted by the Christian pop artist Callann Lane, scheduled to be broadcast on the TBN network in mid-2011.\r\n\r\nBroken came to Fezziwig with just a logo, and wanted a polished, slick looking site that would help sell the DVD and soundtrack CD of the musical.\r\n\r\nFezziwig created a Genesis Framework child theme based on Amped, customized to match the Broken  logo\'s color scheme.\r\n\r\nPlease click on the images at right to view enlarged screen shots.\r\n\r\n</div>\r\n<!--?php next_post_link(\'format\', \'link\', \'in_same_cat\'); ?-->','Broken: A Musical','','publish','closed','closed','','broken-a-musical','','','2013-12-09 14:40:33','2013-12-09 22:40:33','',0,'http://fezziwigwebworks.com/?p=17',0,'post','',0),(26,1,'2011-04-16 23:13:17','2011-04-16 23:13:17','','Options','','private','closed','closed','','options','','','2011-04-16 23:13:17','2011-04-16 23:13:17','',0,'http://fezziwigwebworks.com/?option-tree=options',0,'option-tree','',0),(27,1,'2011-04-16 23:14:00','2011-04-16 23:14:00','','Media','','private','closed','closed','','media','','','2011-04-16 23:14:00','2011-04-16 23:14:00','',0,'http://fezziwigwebworks.com/?option-tree=media',0,'option-tree','',0),(35,1,'2011-04-21 05:23:58','0000-00-00 00:00:00','<a href=\"http://fezziwig.wpengine.com/wp-content/uploads/2011/04/0014-5_EPK.jpg\"><img class=\"alignnone size-medium wp-image-4\" title=\"0014-5_EPK\" src=\"http://fezziwig.wpengine.com/wp-content/uploads/2011/04/0014-5_EPK-300x199.jpg\" alt=\"\" width=\"300\" height=\"199\" /></a>','','','draft','closed','closed','','','','','2011-04-21 05:23:58','2011-04-21 05:23:58','',0,'http://fezziwigwebworks.com/?post_type=project&p=35',0,'project','',0),(41,1,'2011-04-21 06:09:30','2011-04-21 06:09:30','','Main Image','','publish','closed','closed','','main-image','','','2011-04-21 06:09:36','2011-04-21 06:09:36','',0,'http://fezziwigwebworks.com/?post_type=acf&p=41',0,'acf','',0),(50,2,'2010-02-18 01:41:39','2010-02-18 01:41:39','[gravityform id=1 title=false description=true]','Contact Us','','publish','open','closed','','contact-us','','','2011-07-07 15:49:03','2011-07-07 15:49:03','',0,'http://localhost/GenesisTest/?page_id=50',40,'page','',0),(186,2,'2010-02-18 01:29:24','2010-02-18 01:29:24','','Blog','','draft','open','closed','','blog','','','2011-06-01 16:26:19','2011-06-01 16:26:19','',0,'http://localhost/GenesisTest/?page_id=44',10,'page','',0),(456,1,'2010-04-25 04:02:20','2010-04-25 04:02:20','<div id=\"postgallery-wrapper\">[nggallery id=7]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\n\"Junk Drawer Photos\" is a collection of images that photographer Richard Gilbert has been making of his friends\' and acquaintances\', well, junk drawers.\r\n\r\nThis site is a pure PHP site, coded without the use of a content management system.\r\n\r\nPlease click on the images at right to view enlarged screen shots.\r\n\r\n</div>','Junk Drawer Photos','','publish','closed','closed','','junk-drawer-photos','','','2013-12-09 14:43:48','2013-12-09 22:43:48','',0,'http://localhost/BeeCrafty/?p=456',0,'post','',0),(461,1,'2010-04-25 04:04:39','2010-04-25 04:04:39','<div id=\"postgallery-wrapper\">[nggallery id=10]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nThe Society for Commercial Archeology is an international membership organization, dedicated to the interpretation and preservation of the 20th century commercial roadside landscape.\r\n\r\nFezziwig\'s work for the SCA consists of Drupal-based web design and development, including a CiviCRM-based membership management component and provisions for online registrations and renewals.\r\n\r\nPlease visit the site at <a href=\"http://sca-roadside.org\" target=\"_blank\">sca-roadside.org</a>, or click on the images at right to view enlarged screen shots.\r\n\r\n</div>','SCA Web Site','','publish','closed','closed','','sca-web-site','','','2011-05-31 17:47:12','2011-05-31 17:47:12','',0,'http://localhost/BeeCrafty/?p=461',0,'post','',0),(467,1,'2010-04-25 04:07:04','2010-04-25 04:07:04','<div id=\"postgallery-wrapper\">[nggallery id=9]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nOikocredit Northwest is a local support organization for Oikocredit UA, an international development cooperative that empowers poor and marginalized people around the world with credit.\r\n\r\nFezziwig has been working with Oikocredit Northwest to establish a web presence, complete with graphic design, Drupal web development, and development of a CiviCRM-based database of members and contacts.\r\n\r\nPlease click on the images at right to view enlarged screen shots.\r\n\r\n</div>','Oikocredit Northwest','','draft','closed','closed','','oikocredit-northwest','','','2013-12-10 11:07:53','2013-12-10 19:07:53','',0,'http://localhost/BeeCrafty/?p=467',0,'post','',0),(805,1,'2011-05-18 06:56:57','2011-05-18 06:56:57','','Screen shot 2011-05-17 at 11.54.41 PM','','inherit','closed','open','','screen-shot-2011-05-17-at-11-54-41-pm','','','2011-05-18 06:56:57','2011-05-18 06:56:57','',0,'http://fezziwigwebworks.com/wp-content/uploads/2011/05/Screen-shot-2011-05-17-at-11.54.41-PM.png',0,'attachment','image/png',0),(807,1,'2011-05-18 07:02:13','2011-05-18 07:02:13','','Screen shot 2011-05-18 at 12.00.28 AM','','inherit','closed','open','','screen-shot-2011-05-18-at-12-00-28-am','','','2011-05-18 07:02:13','2011-05-18 07:02:13','',14,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/Screen-shot-2011-05-18-at-12.00.28-AM.png',0,'attachment','image/png',0),(809,1,'2011-05-18 07:04:25','2011-05-18 07:04:25','','dean','','inherit','closed','open','','dean','','','2011-05-18 07:04:25','2011-05-18 07:04:25','',12,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/dean.png',0,'attachment','image/png',0),(811,1,'2011-05-18 07:06:31','2011-05-18 07:06:31','','Screen shot 2011-05-18 at 12.05.16 AM','','inherit','closed','open','','screen-shot-2011-05-18-at-12-05-16-am','','','2011-05-18 07:06:31','2011-05-18 07:06:31','',7,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/Screen-shot-2011-05-18-at-12.05.16-AM.png',0,'attachment','image/png',0),(813,1,'2011-05-18 07:08:30','2011-05-18 07:08:30','','Screen shot 2011-05-18 at 12.07.19 AM','','inherit','closed','open','','screen-shot-2011-05-18-at-12-07-19-am','','','2011-05-18 07