 10.33.40 AM','','inherit','closed','open','','screen-shot-2011-05-18-at-10-33-40-am','','','2011-05-18 17:35:38','2011-05-18 17:35:38','',17,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/Screen-shot-2011-05-18-at-10.33.40-AM.png',0,'attachment','image/png',0),(828,1,'2011-05-18 17:37:25','2011-05-18 17:37:25','','broken','','inherit','closed','open','','broken','','','2011-05-18 17:37:25','2011-05-18 17:37:25','',17,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/broken.jpg',0,'attachment','image/jpeg',0),(830,1,'2011-05-18 17:39:54','2011-05-18 17:39:54','','mike','','inherit','closed','open','','mike','','','2011-05-18 17:39:54','2011-05-18 17:39:54','',7,'http://fezziwigwebworks.com/wp-content/uploads/2011/04/mike.png',0,'attachment','image/png',0),(833,1,'2011-05-21 21:57:14','2011-05-21 21:57:14','Does this appear?','Our Work','','publish','closed','closed','','our-work','','','2011-07-07 15:47:32','2011-07-07 15:47:32','',0,'http://fezziwigwebworks.com/?page_id=833',20,'page','',0),(835,1,'2011-05-21 21:57:14','2011-05-21 21:57:14',' ','','','publish','closed','open','','835','','','2011-08-04 19:38:20','2011-08-04 19:38:20','',0,'http://fezziwigwebworks.com/?p=835',3,'nav_menu_item','',0),(878,1,'2011-06-01 15:33:21','2011-06-01 15:33:21','Fezziwig Web Works is, essentially, one guy from New Jersey and another from Western New York, who have known each other and have worked together since the turn of the century.\r\n\r\nWe have been building web sites both together and apart for the past 15 years -- since nearly the dawn of Internet time!\r\n\r\nBuilding sites with <a href=\"http://www.wordpress.org\">WordPress</a>, and in particular using the <a href=\"http://www.studiopress.com\">Genesis theming framework by Studiopress</a>, is our passion;  we can put together a team that is perfectly suited to any web project, at any level of sophistication.\r\n\r\nWe are always looking for new opportunities to put out talents to work on sophisticated web sites, and we look forward to discussing your current web needs and how we can help you achieve them.\r\n\r\nPlease take the time to fill out our <a title=\"Contact Us\" href=\"http://fezziwig.wpengine.com/?page_id=50\">contact form</a>, so that we may be in touch!','About Us','','publish','closed','open','','about-us','','','2012-06-26 10:00:39','2012-06-26 17:00:39','',0,'http://fezziwigwebworks.com/?page_id=878',0,'page','',0),(880,1,'2011-06-01 15:33:21','2011-06-01 15:33:21',' ','','','publish','closed','open','','880','','','2011-08-04 19:38:20','2011-08-04 19:38:20','',0,'http://fezziwigwebworks.com/?p=880',2,'nav_menu_item','',0),(890,1,'2011-06-01 16:25:31','2011-06-01 16:25:31','','Home Page','','publish','closed','open','','home-page','','','2011-06-01 16:25:31','2011-06-01 16:25:31','',0,'http://fezziwigwebworks.com/?page_id=890',0,'page','',0),(892,1,'2011-06-01 16:25:31','2011-06-01 16:25:31',' ','','','publish','closed','open','','892','','','2011-08-04 19:38:20','2011-08-04 19:38:20','',0,'http://fezziwigwebworks.com/?p=892',1,'nav_menu_item','',0),(908,1,'2011-08-04 19:37:32','2011-08-04 19:37:32','We are generally available at a rate of $100/ hour, though we have been known to work on a per-project basis, and are open to negotiation in order to work within your budget.  We can also offer daily rates, or volume discounts for larger projects spanning multiple hours.  And, we have always been known to go \"above and beyond\" in our design and development work, so your money will be very well spent.\r\n\r\nLet us know what you have in mind, and we\'ll deliver the best possible product within the scope of your budget.','Rates','','publish','closed','closed','','rates','','','2012-02-29 21:50:27','2012-02-29 21:50:27','',0,'http://fezziwigwebworks.com/?page_id=908',35,'page','',0),(910,1,'2011-08-04 19:37:33','2011-08-04 19:37:33',' ','','','publish','closed','open','','910','','','2011-08-04 19:38:20','2011-08-04 19:38:20','',0,'http://fezziwigwebworks.com/2011/08/04/910/',4,'nav_menu_item','',0),(915,1,'2011-08-13 06:02:44','2011-08-13 06:02:44','[show-ics-calendar]','Events Calendar','','draft','closed','closed','','events-calendar','','','2011-08-14 04:48:10','2011-08-14 04:48:10','',0,'http://fezziwigwebworks.com/?page_id=915',0,'page','',0),(917,1,'2011-08-13 06:02:44','2011-08-13 06:02:44',' ','','','publish','closed','open','','917','','','2011-08-13 06:02:44','2011-08-13 06:02:44','',0,'http://fezziwigwebworks.com/2011/08/13/917/',5,'nav_menu_item','',0),(933,1,'2013-12-09 18:16:08','2013-12-10 02:16:08','<div id=\"postgallery-wrapper\">[nggallery id=11]</div>\r\n<div id=\"postcontent-wrapper\">\r\n\r\nKurt Baker is a pop artist based in Portland, Maine.\r\n\r\nFezziwig was asked to create a Genesis Framework child theme to support Kurt\'s \"Rockin\' For A Living\" album.  We created the child theme using StudioPress\'s baseline \"Child\" theme.\r\n\r\nPlease <a href=\"http://kurtbakermusic.fezziwigwebworks.com/\" target=\"_blank\">click here to visit the site we designed for Kurt</a>, or click on the images at right to view enlarged screen shots.\r\n</div>','Kurt Baker Music','','publish','closed','open','','kurt-baker-music','','','2013-12-10 08:33:42','2013-12-10 16:33:42','',0,'http://fezziwigwebworks.com/?p=933',0,'post','',0),(934,1,'2013-12-10 08:26:54','2013-12-10 16:26:54','','one','','inherit','closed','open','','one','','','2013-12-10 08:26:54','2013-12-10 16:26:54','',933,'http://fezziwigwebworks.com/wp-content/uploads/2013/12/one.png',0,'attachment','image/png',0),(935,1,'2013-12-10 11:12:29','2013-12-10 19:12:29','<div id=\"postgallery-wrapper\">[nggallery id=12]</div>\r\n<div id=\"postcontent-wrapper\">\r\nWe were asked to design and implement a WordPress-based landing page to support John Oates\' latest project, \"Good Road To Follow\", a year-long series of twelve new songs, released on his web site on a monthly basis.\r\n\r\nPlease <a href=\"http://johnoates.com/\" target=\"_blank\">click here to visit the site we designed for John</a>, or click on the images at right to view enlarged screen shots.\r\n</div>','John Oates','','publish','closed','open','','john-oates','','','2013-12-10 11:19:54','2013-12-10 19:19:54','',0,'http://fezziwigwebworks.com/?p=935',0,'post','',0),(936,1,'2013-12-10 11:14:18','2013-12-10 19:14:18','','main featured','','inherit','closed','open','','main-featured','','','2013-12-10 11:14:18','2013-12-10 19:14:18','',935,'http://fezziwigwebworks.com/wp-content/uploads/2013/12/main-featured.png',0,'attachment','image/png',0);
