INSERT INTO `wp_rg_lead_detail_long` VALUES (28,'Having too few reviews or want to boost your online presence? \r\n\r\nWe can improve your online reputation by posting positive reviews on major review sites.  People go there when they want to find good, reliable services in which they can trust. \r\n\r\nHaving positive reviews on those sites will drive more people to choose your business and will make your name stand up from all of the other competitors. \r\n\r\nOur services include:\r\n- Improving your reputation by posting good reviews and other links;\r\n- Suppressing negative reviews or other links that might damage your reputation, with positive ones which you can control;\r\n- Increasing your online popularity by creating websites and offering SEO (Search Engine Optimization) services.\r\n\r\nFind out more about how we can help by visiting our website at http://postingonlygoodreviews.com/ \r\n\r\nYou can contact us at makereviews@gmail.com or call us at 512-547-1170.\r\n\r\nThank you for according us your time and understanding\r\n'),(33,'Red8 Interactive is a team of 20 full time developers focused on support mid sized ad and digital agencies, and web design firms. For our customers we are the solution to the freelance shuffle, which means we don\'t generally use freelancers but we have so much Wordpress work and some large Drupal projects in the pipeline that I\'m looking for some expansion capabilities. If you would like to know more, give me a call.\r\n\r\nJames Hipkin\r\nCOO, Managing Director\r\n415-505-0632'),(44,'Backlinks from wikipedia are in a league of their own. The right wikipedia backlink can single-handedly rank a website for it\'s target keyword on google. We speak from experienceYou can also expect significant referral traffic from wikipedia. Another service we offer; creating a wikipedia entry/page for your company or topic of choice is also excellent for search engine reputation management & brand boosting purposes. Of course, you will also get a backlink from the entry to your website. \r\n\r\nhttp://www.sharkim.com/wikipedia.php\r\n\r\nWikipedia editors are notorious for their strict policy in allowing links or company entries. We have realized, over the years- that the best way to get a link to stick in wikipedia, is to ensure that the content it links to is useful and contributes to the entry. We have formulated fool-proof methods to ensure that links stick; including the sourcing/creation of useful content which we can advise you to include on any page you\'d like, and association with hundreds of cooperative editors to overcome any edit-wars and vote against deletion. We are a professional operation. When you hire us, you can be assured of results. We have acquired thousands of backlinks from wikipedia for our clients, and created 50 company & biography entries.\r\n\r\nhttp://www.sharkim.com/wikipedia.php\r\n\r\nOur motto is that a happy customer is a repeat customer.'),(45,'Statistics show that millions of people are now searching online for services or information about companies. Would you like to be the one they choose? We have been helping companies reach their full potential, rise above their competition and finally get an excellent return of investment. Why not give it a try? It'),(47,'Gregory Heller suggest I reach out to you. I work at an agency that has some Drupal development needs. We are finishing up a project that the client slowed down and running into our primary developers vacation.\r\n\r\nThe site is 90 percent there, so this particular work be finishing it out. \r\n\r\nMore broadly we use WordPress as well and would be interested in connecting in general for other projects. '),(49,'I\'m not sure if you have checked it out yet, but I am doing a Genesis Developer and Designer survey and I would love to include your answers. You can check it out at http://marketplicity.com/genesis-wordpress-survey-2013/.\r\n  The first annual Genesis Framework Developer and Designer Survey is my little contribution to the community that has given so much to me. The aim of the survey is to give Genesis developers and designers a better idea about their peers when it comes to topics like pricing, experience, best resources, etc…  Also any promotion you could lend to the survey would be appreciated. Here are a few ideas I thought of - \r\n\r\n- A #genesiswp tweet\r\n- Sharing the survey on Google+\r\n- A link or shout-out to the survey on your blog somewhere\r\n\r\n  Any and all help you can give is appreciated! \r\n\r\nThanks and let me know if you have any questions,\r\nChris\r\n'),(53,'I realized while I was on your website that you have a Wordpress website.  At first it seemed a bit sluggish and was a little slow to load.   I also had this problem a while ago with one of my Wordpress sites.   Webhosts like Godaddy, Host Gator, Blue Host, etc often overcrowd their shared hosting plans which can be bad for your website, have you ever looked into this?\r\n\r\nThere'),(54,'I realized while I was on your website that you have a Wordpress website.  At first it seemed a bit sluggish and was a little slow to load.   I also had this problem a while ago with one of my Wordpress sites.   Webhosts like Godaddy, Host Gator, Blue Host, etc often overcrowd their shared hosting plans which can be bad for your website, have you ever looked into this?\r\n\r\nThere'),(55,'A Wikipedia page is undeniably the best thing that you can do for your reputation. It is the ultimate sign of \"having made it\". However, Wikipedia is notoriously strict about the criteria for pages to be published. We have been contributing useful content to Wikipedia since more than a decade and have the experience and expertise required to publish a Wikipedia page for You. We\'ll help you with references and sources to help meet Wikipedia\'s guidelines for notability. We know exactly what it takes to meet the stringent ');
